%[text] # テスト
%[text] ## 初期値
a=1;
vl=VirtualLink;
%[text] ##  テスト
%% test1
a=a+1;
assert(a==2);
%[text] test2は連続的に実行すると失敗するが，独立に実施すると通る．
%% test2
a=a+2;
assert(a==3); %[output:61df517d]
%%
%[text] ## Disk of spine
%% abalone disk
vl.setData(GaussCode={[1,-1]},orientation=1)
tbl=vl.getDiskTable;
weight=-(tbl.delta\tbl.cp)' %[output:49e36d8c]
%%

%% negative abalone disk 
vl.setData(GaussCode={[1,-1]},orientation=-1)
tbl=vl.getDiskTable;
weight=-(tbl.delta\tbl.cp)'
%%

%% abalone knot compl
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl;
tbl=vl.getDiskTable;
weight=-(tbl.delta\tbl.cp)' %[output:3a5fdb09] %[output:7fe9d271]
tbl.delta*weight'+tbl.cp %[output:5e0d4791]
dx=tbl.delta;
dx=dx(:,[1,3,5,7]) %[output:094d52c2]
dx*[0;1;1;-1]+tbl.cp %[output:8c23ac70]
%%
%% abalone knot complement and add loop
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl;
[gc,ori]=vl.getGaussCode;
gc{1}(end+1)=-5;
gc{3}=[5];
ori(end+1)=1;
vl.setData(GaussCode=gc,orientation=ori)
% tbl=vl.getDiskTable;
vl.calcWeight %[output:25d29f14]
%%
%% plot abalone
vl.setData(GaussCode={[1,-1]},orientation=-1)
vl.plot %[output:660ab4c4] %[output:76675893]
vl.plotSage %[output:7cc90bd7]
vl.setData(RGaussCode={[1,-1]},orientation=1)
vl.plot %[output:9823a46d] %[output:6bf5b794]
vl.plotSage %[output:41c14103]
%%
%% trefoil
vl.setData(table=[3,1])
vl.plot %[output:0f143fa7] %[output:007ef5df]
vl.plotSage %[output:6bb0d564]
vl.plot(virtual=false) %[output:088905cd] %[output:3f4a4396]
%[text] ![](text:image:0cef)
%%
vl.setData(GaussCode={[1,-1,-3,3,-2,2]},orientation=[-1,0,1])
vl.plot %[output:57d0e408] %[output:18f16451]
%[text] 
pd=vl.getPDCode %[output:73a18ea5]
[gc,ori]=vl.getRGaussCode %[output:29026a0d] %[output:03d1c375]
vl.getRPDCode %[output:9a223d3b]
vl.setData(PDCode=pd+1)
[gc,ori]=vl.getGaussCode %[output:2bed0b18] %[output:0dd8f12d]
vl.plot %[output:55999f0c] %[output:56465708]

%%
%% from table
vl.setData(table=[7,4])
vl.plot %[output:56ec1a23] %[output:4b264356]
close all
%%
%% plot Virtual Link
vl.setData(Gauss={[1,3,-3,-2],[-1,2]},ori=[1,0,1])
vl.plot(virtual=false,bendingNumbers={[1,2,-3,0,3,1]}) %[output:41f77a19] %[output:13dbbf06]
%%
%[text] ## plot weighted virtual link
vl=VirtualLink %[output:44560761]
vl.setData(RGauss={[1,2,-2],[-1]},ori=[1,1])
vl.calcVG2G %[output:08e67b22]
vl.plot
vl.setData(RGauss={[1,2,-2],[-1]},ori=[1,1])
vl.plot
%%
%% plot Lens space 2 1
vl.setData(GaussCode={[1,-3,2,-2,3,-1]},orientation=[1,1,0])
vl.setWeight([0,1,-1,-1])
vl.plot(virtual=false,bendingNumbers={[3,-1,1,-3,1,-1]}) %[output:58e81ecd] %[output:1cf3305c]
%[text] ![](text:image:33f8)
vl.plot(bendingNumbers={[3,-1,1,-3,1,-1]}) %[output:7a5f68d0] %[output:8d8cd8a0]
%%
%% plot abalone with weight
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.setWeight([1,-2])
vl.plot %[output:3cb38066] %[output:89c88446]
%%
%% calc weight of L 2 1
vl.setData(GaussCode={[1,-3,2,-2,3,-1]},orientation=[1,1,0])
vl.calcWeight %[output:1ee15d25] %[output:8ef566d5]
vl.getMatrixHMove' %[output:4d16dd1e]
%%
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl
vl %[output:7ceb3498]
vl.plot(virtual=false) %[output:97a57b9d] %[output:432227ca]
vl.calcWeight %[output:1ccb14b8] %[output:5f193b6d]
%%
vl=VirtualLink %[output:96e3b1d9]
vl.setData(RG={[1,2,-2,-3,-5],[-4,-1,3,4],[5]},ori=[-1,1,-1,1,1])
vl.plot %[output:19578070] %[output:1c589520]
[wei,z,v]=vl.calcWeight; %[output:9b22752f]
vl.setWeight(v(1,:));
vl.plot %[output:2500183c] %[output:1d6c5300]
